import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import '../css/FullPage.css';

const FitnessPage = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const { planText } = location.state || {};

  return (
    <div className="full-page-container">
      <div className="page-header header-fitness">
        <h1 className="page-title">💪 תוכנית כושר גופני</h1>
        <button className="btn-back" onClick={() => navigate(-1)}>חזור לדשבורד ↩</button>
      </div>

      <div className="content-box">
        <div className="text-content">
          {planText || "לא נמצאה תוכנית כושר."}
        </div>
      </div>
    </div>
  );
};

export default FitnessPage;
